<H1><A NAME="u4008"></A><SUP></SUP>NMAKE Warning U4008</H1>

<P class=dt><B>removed target 'target'</B></P>

<P>NMAKE was interrupted while trying to build the given target, and the target file was incomplete. Because the target was not specified in the <B>.PRECIOUS</B> list, NMAKE deleted the file.</P>
